      DO  i=1,4
      DO l=1,4
      s=0 
      DO k=1,4 
       s=s+Z(i,k)*M(k)*Z(l,k)
      ENDDO
      MM(i,l)=s
      ENDDO
      ENDDO
      

      m1_=MM(1,1)
      m2_=MM(2,2)
      mu_=-MM(4,3) 

      tw=-MM(1,3)/MM(2,3)
      w=datan(tw)
      SW_=sin(w)
      tb_=-MM(1,4)/MM(1,3)
      cb=cos(datan(tb_))
